import {
    SetupFunctionalContent,
    SetupFunctionalContainer,
    SetupHeroContainer,
    SetupStepIcon,
    SetupWrapper, SetupHeroStyling, SetupH1
} from "../styled/Setup.styled";
import {LoginSubtitle, LoginTitle} from "../styled/Login.styled";
import {useGoogleLogin} from '@react-oauth/google';
import {MagicButton} from "../components/Buttons";
import Hero from "../assets/batman-robin-heroes.svg"

function SetupAboutMe() {
    return (
        <SetupWrapper>
            <SetupHeroStyling/>
            <SetupFunctionalContainer>
                <SetupFunctionalContent>
                    <SetupStepIcon className="bi bi-house-door"></SetupStepIcon>
                    <SetupH1>1/<br/>Faisons connaissance!</SetupH1>
                </SetupFunctionalContent>
            </SetupFunctionalContainer>
            <SetupHeroContainer>
                <i className="bi bi-people-fill setup-hero"></i>
            </SetupHeroContainer>
        </SetupWrapper>
    );
}

export default SetupAboutMe;
